    // Generate tracking updates
    const statusUpdates = [
      { status: 'Request Received', days: 0 },
      { status: 'Routed to Department', days: 0.5 },
      { status: 'Assigned to Staff', days: 1 },
      { status: 'Assessment Complete', days: 2 },
      { status: 'Work Scheduled', days: 3 },
      { status: 'Work in Progress', days: 5 }
    ];

    if (status === 'Closed') {
      statusUpdates.push({ status: 'Work Complete', days: daysOpen - 1 });
      statusUpdates.push({ status: 'Verified', days: daysOpen });
    }

    const numUpdates = status === 'Closed' ? statusUpdates.length : Math.min(Math.floor(Math.random() * 4 + 2), statusUpdates.length);

    for (let j = 0; j < numUpdates; j++) {
      const update = statusUpdates[j];
      const updateDate = new Date(createdDate.getTime() + update.days * 24 * 60 * 60 * 1000);

      if (updateDate <= endDate) {
        tracking.push({
          service_request_number: request.service_request_number,
          status: update.status,
          updated_at: updateDate.toISOString(),
          department: department
        });
      }
    }
  }

  console.log(`âœ… Generated ${requests.length} sample requests from 2025 with ${tracking.length} tracking events`);

  return { requests, tracking };
